"""#Train Test Split"""

from sklearn.model_selection import train_test_split

X_train, X_test, y_train, y_test =train_test_split(x,y,test_size=0.3)

X_train.info()

X_test.info()

"""# Select Model ML"""

from sklearn.linear_model import LinearRegression
lm = LinearRegression()

"""# Trainig"""

lm.fit(X_train, y_train )  # Training

"""#Testing"""

predictions = lm.predict(X_test)  # Testing

"""# Model Evaluation

# Error Calcuation

![Slide1.JPG](data:image/jpeg;base64,)
"""

import numpy as np   # Evaluation
import sklearn.metrics as metrics
print('MAE: {}'.format(metrics.mean_absolute_error(y_test, predictions)))
print('MSE: {}'.format(metrics.mean_squared_error(y_test, predictions)))
print('RMSE: {}'.format(np.sqrt(metrics.mean_squared_error(y_test, predictions))))

df.columns

"""# Comapre Train, Test and Predicted Data"""

import plotly.graph_objects as go

# Assuming you have already fitted a linear regression model called 'lm'

# Generate x values for prediction
x = np.linspace(x.min(), x.max(), 100)

# Predict y values using the linear regression model
y = lm.predict(x.reshape(-1, 1))

# Create the scatter plot figure
fig = go.Figure()

# Add the scatter plot of training data
fig.add_trace(go.Scatter(x=X_train.squeeze(), y=y_train, name='Train', mode='markers'))

# Add the scatter plot of test data
fig.add_trace(go.Scatter(x=X_test.squeeze(), y=y_test, name='Test', mode='markers'))

# Add the line plot of predicted values
fig.add_trace(go.Scatter(x=x, y=y, name='Prediction'))

# Show the figure
fig.show()

